import Card from '../UI/Card'
import classes from './ProductDetail.module.css'
import ProductItem from './ProductItem/ProductItem'

const DUMMY_PRODUCTS = [
  {
    id: 'm1',
    name: 'Men Shirt',
    brand: 'Gucci',
    sku: 'GUCCIMEN',
    price: 22.99,
    quantity: 200
  },
  {
    id: 'm2',
    name: 'Ladies Shirt',
    brand: 'Versace',
    sku: 'GUCCIMEN',
    price: 22.99,
    quantity: 200
  },
  {
    id: 'm3',
    name: 'Men Shirt',
    brand: '',
    sku: 'GUCCIMEN',
    price: 22.99,
    quantity: 200
  },
  {
    id: 'm4',
    name: 'Men Shirt',
    brand: 'Gucci',
    sku: 'GUCCIMEN',
    price: 22.99,
    quantity: 200
  }
]

const ProductDetail = props => {
  const productList = DUMMY_PRODUCTS.map(product => (
    <ProductItem
      key={product.id}
      name={product.name}
      brand={product.brand}
      price={product.price}
    />
  ))

  return (
    <section className={classes.products}>
      <Card>
        <ul>{productList}</ul>
      </Card>
    </section>
  )
}

export default ProductDetail
